      <name id="9" justification="1" size="4" underlined="false">
        <text>A car simulator is needed.

      </name>

      <name id="14" justification="1" size="4" underlined="false">
        <text>Classes that will be used include road, traffic light, car,

      <textColor reference="20"/>
      <name id="31" justification="1" size="4" underlined="false">
        <text>It will use some algorithms such as random,
if and else if, etc. Random algorithm is
used to generate vehicles whereas if and else if
algorithm is used to determine whether a vehicle will 
turn or not.</text>
      </name>
    </ActivityNode>
    <ActivityNode id="32">

      <borderColor reference="20"/>
      <textColor reference="20"/>
      <name id="36" justification="1" size="4" underlined="false">
        <text>A random number will be picked
and a limiter (if and else if) will determine
if the value is true or not.
If a traffic light is red, the vehicles will not
move, when it&apos;s green, the vehicles will move.</text>
      </name>
    </ActivityNode>
